/****** Object:  StoredProcedure [dbo].[sp_exam_Correction]    Script Date: 3/29/2021 12:39:14 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[sp_exam_Correction] @stud_id int, @exam_id int
AS
DECLARE @total_questions int
SELECT  @total_questions = count(QuesId) FROM Student_Exam
WHERE  StudId = @stud_id AND ExamId = @exam_id

DECLARE @total_right_questions float
SELECT  @total_right_questions = count(SE.QuesId) 
FROM Student_Exam SE JOIN Question Q ON SE.QuesId = Q.QuesId
WHERE  StudId = @stud_id AND ExamId = @exam_id AND SE.StudQuesAns = Q.QuesAnswer

DECLARE @Grade float
SELECT  @Grade = @total_right_questions/@total_questions*100

UPDATE Student_Course
SET	   Grade = @Grade
WHERE  StuId = @stud_id and CurId = (Select CurId from Exam where ExamId = @exam_id)

SELECT 'student degree percentage' + str(@Grade) + '%'
GO
/****** Object:  StoredProcedure [dbo].[sp_exam_generation]    Script Date: 3/29/2021 12:39:14 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[sp_exam_generation]  @cur_Id INT, @no_TF INT, @no_ML INT, @exam_time INT, @exam_gread INT
AS
BEGIN
	INSERT INTO Exam(ExamGrade , ExamTime, CurId)
	VALUES     (@exam_gread, @exam_time,@cur_Id)

DECLARE @ex_id INT
SELECT  @ex_id = MAX(ExamId) FROM Exam

INSERT INTO Exam_Question    --Generate true & false Question
	SELECT TOP(@no_TF) @ex_id, Q.QuesId
	FROM Question Q JOIN course C ON C.CurId =Q.CurId
	WHERE C.CurId = @cur_Id AND Q.QuesType IN('TF')
	ORDER BY NEWID()	

INSERT INTO Exam_Question	--Generate true & false Question
	SELECT TOP(@no_ML) @ex_id, Q.QuesId
	FROM Question Q JOIN course C ON C.CurId =Q.CurId
	WHERE C.CurId = @cur_Id AND Q.QuesType IN('MC')
	ORDER BY NEWID()

SELECT  Q.QuesId, Q.question, A, B, C, D  --Return Exam Question
	FROM Question Q INNER JOIN Choices mcq ON Q.QuesId =mcq.QuesId
	JOIN Exam_Question EX ON Q.QuesId = EX.QuesId
	WHERE EX.ExamId = @ex_id

END
GO
