CREATE PROC [dbo].[sp_getAllDepartmentsInfo] 
AS
SELECT d.DeptId, d.DeptName, m.InsFname+m.InsLname AS 'Manager Name',
		i.InsId, i.InsFname, s.StudID, s.StudFname + s.StudLname as 'Student Name'
FROM
	Department d
JOIN Student s ON d.DeptId = s.DeptId
JOIN instructor i ON d.DeptId = i.DeptId
JOIN instructor m ON d.MangerID = m.InsId


GO
